00028     public IExpressionNode AnyMergeToken(
00029         IExpressionNode expressionPrimary, ISyntaxToken token, IParserModel model)
00030     {
00031         #if DEBUG
00032         Console.WriteLine($"{expressionPrimary.SyntaxKind} + {token.SyntaxKind}");
00033         #endif
00034     
00035         if (token.SyntaxKind == SyntaxKind.MemberAccessToken)
00036         {
00037             if (expressionPrimary.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
00038             {
00039                 var ambiguousIdentifierExpressionNode = (AmbiguousIdentifierExpressionNode)expressionPrimary;
00040                 
00041                 if (!ambiguousIdentifierExpressionNode.FollowsMemberAccessToken)
00042                 {
00043                     ForceDecisionAmbiguousIdentifier(
00044                         EmptyExpressionNode.Empty,
00045                         ambiguousIdentifierExpressionNode,
00046                         model);
00047                 }
00048             }
00049             
00050             return EmptyExpressionNode.EmptyFollowsMemberAccessToken;
00051         }
00052         
00053         switch (expressionPrimary.SyntaxKind)
00054         {
00055             case SyntaxKind.EmptyExpressionNode:
00056                 return EmptyMergeToken((EmptyExpressionNode)expressionPrimary, token, model);
00057             case SyntaxKind.LiteralExpressionNode:
00058                 return LiteralMergeToken((LiteralExpressionNode)expressionPrimary, token, model);
00059             case SyntaxKind.BinaryExpressionNode:
00060                 return BinaryMergeToken((BinaryExpressionNode)expressionPrimary, token, model);
00061             case SyntaxKind.ParenthesizedExpressionNode:
00062                 return ParenthesizedMergeToken((ParenthesizedExpressionNode)expressionPrimary, token, model);
00063             case SyntaxKind.CommaSeparatedExpressionNode:
00064                 return CommaSeparatedMergeToken((CommaSeparatedExpressionNode)expressionPrimary, token, model);
00065             case SyntaxKind.FunctionInvocationNode:
00066                 return FunctionInvocationMergeToken((FunctionInvocationNode)expressionPrimary, token, model);
00067             case SyntaxKind.LambdaExpressionNode:
00068                 return LambdaMergeToken((LambdaExpressionNode)expressionPrimary, token, model);
00069             case SyntaxKind.ConstructorInvocationExpressionNode:
00070                 return ConstructorInvocationMergeToken((ConstructorInvocationExpressionNode)expressionPrimary, token, model);
00071             case SyntaxKind.ExplicitCastNode:
00072                 return ExplicitCastMergeToken((ExplicitCastNode)expressionPrimary, token, model);
00073             case SyntaxKind.AmbiguousIdentifierExpressionNode:
00074                 return AmbiguousIdentifierMergeToken((AmbiguousIdentifierExpressionNode)expressionPrimary, token, model);
00075             case SyntaxKind.TypeClauseNode:
00076                 return TypeClauseMergeToken((TypeClauseNode)expressionPrimary, token, model);
00077             case SyntaxKind.VariableAssignmentExpressionNode:
00078                 return VariableAssignmentMergeToken((VariableAssignmentExpressionNode)expressionPrimary, token, model);
00079             case SyntaxKind.GenericParametersListingNode:
