00081             case SyntaxKind.FunctionParametersListingNode:
00082                 return FunctionParametersListingMergeToken((FunctionParametersListingNode)expressionPrimary, token, model);
00083             case SyntaxKind.FunctionArgumentsListingNode:
00084                 return FunctionArgumentsListingMergeToken((FunctionArgumentsListingNode)expressionPrimary, token, model);
00085             case SyntaxKind.BadExpressionNode:
