00134     public IExpressionNode AmbiguousIdentifierMergeToken(
00135         AmbiguousIdentifierExpressionNode ambiguousIdentifierExpressionNode, ISyntaxToken token, IParserModel model)
00136     {
00137         if (token.SyntaxKind == SyntaxKind.OpenParenthesisToken &&
00138             ambiguousIdentifierExpressionNode.Token.SyntaxKind == SyntaxKind.IdentifierToken)
00139         {
00140             var functionParametersListingNode = new FunctionParametersListingNode(
00141                 (OpenParenthesisToken)token,
00142                 new List<FunctionParameterEntryNode>(),
00143                 closeParenthesisToken: default);
00144         
00145             // TODO: ContextualKeywords as the function identifier?
00146             var functionInvocationNode = new FunctionInvocationNode(
00147                 (IdentifierToken)ambiguousIdentifierExpressionNode.Token,
00148                 functionDefinitionNode: null,
00149                 ambiguousIdentifierExpressionNode.GenericParametersListingNode,
00150                 functionParametersListingNode,
00151                 CSharpFacts.Types.Void.ToTypeClause());
00152                 
00153             BindFunctionInvocationNode(
00154                 functionInvocationNode,
00155                 (CSharpParserModel)model);
00156 
00157             model.ExpressionList.Add((SyntaxKind.CloseParenthesisToken, functionInvocationNode));
00158             model.ExpressionList.Add((SyntaxKind.CommaToken, functionInvocationNode.FunctionParametersListingNode));
00159             return EmptyExpressionNode.Empty;
00160         }
00161         else if (token.SyntaxKind == SyntaxKind.OpenAngleBracketToken)
00162         {
00163             if (ambiguousIdentifierExpressionNode.GenericParametersListingNode is null)
00164             {
00165                 ambiguousIdentifierExpressionNode.SetGenericParametersListingNode(
00166                     new GenericParametersListingNode(
00167                         (OpenAngleBracketToken)token,
00168                         new List<GenericParameterEntryNode>(),
00169                         closeAngleBracketToken: default));
00170             }
00171             
00172             model.ExpressionList.Add((SyntaxKind.CloseAngleBracketToken, ambiguousIdentifierExpressionNode));
00173             model.ExpressionList.Add((SyntaxKind.CommaToken, ambiguousIdentifierExpressionNode.GenericParametersListingNode));
00174             return EmptyExpressionNode.Empty;
00175         }
00176         else if (token.SyntaxKind == SyntaxKind.CloseAngleBracketToken)
00177         {
00178             if (ambiguousIdentifierExpressionNode.GenericParametersListingNode is not null)
00179             {
00180                 ambiguousIdentifierExpressionNode.GenericParametersListingNode.SetCloseAngleBracketToken((CloseAngleBracketToken)token);
00181                 return ambiguousIdentifierExpressionNode;
00182             }
00183         }
00184         else if (token.SyntaxKind == SyntaxKind.EqualsToken)
00185         {
00186             if (model.TokenWalker.Next.SyntaxKind == SyntaxKind.CloseAngleBracketToken)
00187             {
00188                 var lambdaExpressionNode = new LambdaExpressionNode(CSharpFacts.Types.Void.ToTypeClause());
00189                 SetLambdaExpressionNodeVariableDeclarationNodeList(lambdaExpressionNode, ambiguousIdentifierExpressionNode, model);
00190                 return lambdaExpressionNode;
00191             }
00192             
00193             // Thinking about: Variable Assignment, Optional Parameters, and other unknowns.
00194             if (UtilityApi.IsConvertibleToIdentifierToken(ambiguousIdentifierExpressionNode.Token.SyntaxKind))
00195             {
00196                 var variableAssignmentNode = new VariableAssignmentExpressionNode(
00197                     UtilityApi.ConvertToIdentifierToken(ambiguousIdentifierExpressionNode.Token, model),
00198                     (EqualsToken)token,
00199                     EmptyExpressionNode.Empty);
00200              
00201                 model.ExpressionList.Add((SyntaxKind.CommaToken, variableAssignmentNode));
00202                 model.ExpressionList.Add((SyntaxKind.EndOfFileToken, variableAssignmentNode));
00203                 
00204                 return EmptyExpressionNode.Empty;
00205             }
00206             else
00207             {
00208                 model.ExpressionList.Add((SyntaxKind.CommaToken, ambiguousIdentifierExpressionNode));
00209                 return EmptyExpressionNode.Empty;
00210             }
00211         }
00212         else if (token.SyntaxKind == SyntaxKind.IsTokenKeyword)
00213         {
00214             ForceDecisionAmbiguousIdentifier(
00215                 EmptyExpressionNode.Empty,
00216                 ambiguousIdentifierExpressionNode,
00217                 model);
00218                 
00219             _ = model.TokenWalker.Consume(); // Consume the IsTokenKeyword
00220             
00221             if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.NotTokenContextualKeyword)
00222                 _ = model.TokenWalker.Consume(); // Consume the NotTokenKeyword
00223                 
00224             if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.NullTokenKeyword)
00225             {
00226                 _ = model.TokenWalker.Consume(); // Consume the NullTokenKeyword
00227             }
00228             else if (UtilityApi.IsConvertibleToIdentifierToken(model.TokenWalker.Current.SyntaxKind))
00229             {
00230                 ParseTokens.ParseIdentifierToken((CSharpParserModel)model); // Parse the type pattern matching / variable declaration
00231             }
00232             
00233             // Guaranteed to consume 1 further than the secondary loop so have to backtrack 1 time as well.
00234             _ = model.TokenWalker.Backtrack();
00235             
00236             return ambiguousIdentifierExpressionNode;
00237         }
00238         else if (token.SyntaxKind == SyntaxKind.WithTokenContextualKeyword)
00239         {
00240             ForceDecisionAmbiguousIdentifier(
00241                 EmptyExpressionNode.Empty,
00242                 ambiguousIdentifierExpressionNode,
00243                 model);
00244                 
00245             if (model.TokenWalker.Next.SyntaxKind == SyntaxKind.OpenBraceToken)
00246             {
00247                 var withKeywordContextualToken = model.TokenWalker.Consume();
00248             
00249                 #if DEBUG
00250                 model.TokenWalker.SuppressProtectedSyntaxKindConsumption = true;
00251                 #endif
00252                 
00253                 var openBraceToken = (OpenBraceToken)model.TokenWalker.Consume();
00254                 
00255                 var openBraceCounter = 1;
00256                 
00257                 while (true)
00258                 {
00259                     if (model.TokenWalker.IsEof)
00260                         break;
00261         
00262                     if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenBraceToken)
00263                     {
00264                         ++openBraceCounter;
00265                     }
00266                     else if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.CloseBraceToken)
00267                     {
00268                         if (--openBraceCounter <= 0)
00269                             break;
00270                     }
00271         
00272                     _ = model.TokenWalker.Consume();
00273                 }
00274         
00275                 var closeBraceToken = (CloseBraceToken)model.TokenWalker.Match(SyntaxKind.CloseBraceToken);
00276                 
00277                 #if DEBUG
00278                 model.TokenWalker.SuppressProtectedSyntaxKindConsumption = false;
00279                 #endif
00280             }
00281             
00282             return new WithExpressionNode(
00283                 variableIdentifierToken: default,
00284                 openBraceToken: default,
00285                 closeBraceToken: default,
00286                 CSharpFacts.Types.Void.ToTypeClause());
00287         }
00288         else if (token.SyntaxKind == SyntaxKind.IdentifierToken)
00289         {
00290             var decidedExpression = ForceDecisionAmbiguousIdentifier(
00291                 EmptyExpressionNode.Empty,
00292                 ambiguousIdentifierExpressionNode,
00293                 model);
00294             
00295             if (decidedExpression.SyntaxKind != SyntaxKind.TypeClauseNode)
00296             {
00297                 model.DiagnosticBag.ReportTodoException(
00298                     model.TokenWalker.Current.TextSpan,
00299                     "if (decidedExpression.SyntaxKind != SyntaxKind.TypeClauseNode)");
00300                 return decidedExpression;
00301             }
00302         
00303             var identifierToken = (IdentifierToken)model.TokenWalker.Match(SyntaxKind.IdentifierToken);
00304             
00305             var variableDeclarationNode = ParseVariables.HandleVariableDeclarationExpression(
00306                 (TypeClauseNode)decidedExpression,
00307                 identifierToken,
00308                 VariableKind.Local,
00309                 model);
00310                 
00311             return variableDeclarationNode;
00312         }
00313     
00314         return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), ambiguousIdentifierExpressionNode, token);
00315     }
