00329     public IExpressionNode ForceDecisionAmbiguousIdentifier(
00330         IExpressionNode expressionPrimary,
00331         AmbiguousIdentifierExpressionNode ambiguousIdentifierExpressionNode,
00332         IParserModel model,
00333         bool forceVariableReferenceNode = false)
00334     {
00335         if (ambiguousIdentifierExpressionNode.FollowsMemberAccessToken)
00336             return ambiguousIdentifierExpressionNode;
00337     
00338         if (UtilityApi.IsConvertibleToIdentifierToken(ambiguousIdentifierExpressionNode.Token.SyntaxKind))
00339         {
00340             if (TryGetVariableDeclarationHierarchically(
00341                     model,
00342                     model.BinderSession.ResourceUri,
00343                     model.BinderSession.CurrentScopeIndexKey,
00344                     ambiguousIdentifierExpressionNode.Token.TextSpan.GetText(),
00345                     out var existingVariableDeclarationNode))
00346             {
00347                 var identifierToken = UtilityApi.ConvertToIdentifierToken(ambiguousIdentifierExpressionNode.Token, model);
00348                 
00349                 var variableReferenceNode = ConstructAndBindVariableReferenceNode(
00350                     identifierToken,
00351                     (CSharpParserModel)model);
00352                 
00353                 return variableReferenceNode;
00354             }
00355         }
00356         
00357         if (!forceVariableReferenceNode &&
00358             UtilityApi.IsConvertibleToTypeClauseNode(ambiguousIdentifierExpressionNode.Token.SyntaxKind))
00359         {
00360             if (TryGetTypeDefinitionHierarchically(
00361                     model,
00362                     model.BinderSession.ResourceUri,
00363                     model.BinderSession.CurrentScopeIndexKey,
00364                     ambiguousIdentifierExpressionNode.Token.TextSpan.GetText(),
00365                     out var typeDefinitionNode))
00366             {
00367                 var typeClauseNode = UtilityApi.ConvertToTypeClauseNode(ambiguousIdentifierExpressionNode.Token, model);
00368                 BindTypeClauseNode(typeClauseNode, (CSharpParserModel)model);
00369                 return typeClauseNode;
00370             }
00371         }
00372         
00373         // Bind an undefined-TypeClauseNode
00374         if (!forceVariableReferenceNode ||
00375             UtilityApi.IsConvertibleToTypeClauseNode(ambiguousIdentifierExpressionNode.Token.SyntaxKind))
00376         {
00377             var typeClauseNode = UtilityApi.ConvertToTypeClauseNode(ambiguousIdentifierExpressionNode.Token, model);
00378             BindTypeClauseNode(typeClauseNode, (CSharpParserModel)model);
00379             return typeClauseNode;
00380         }
00381         
00382         // Bind an undefined-variable
00383         if (UtilityApi.IsConvertibleToIdentifierToken(ambiguousIdentifierExpressionNode.Token.SyntaxKind))
00384         {
00385             var identifierToken = UtilityApi.ConvertToIdentifierToken(ambiguousIdentifierExpressionNode.Token, model);
00386             
00387             var variableReferenceNode = ConstructAndBindVariableReferenceNode(
00388                 identifierToken,
00389                 (CSharpParserModel)model);
00390             
00391             return variableReferenceNode;
00392         }
00393         
00394         return ambiguousIdentifierExpressionNode;
00395     }
