00411     public IExpressionNode BinaryMergeToken(
00412         BinaryExpressionNode binaryExpressionNode, ISyntaxToken token, IParserModel model)
00413     {
00414         switch (token.SyntaxKind)
00415         {
00416             case SyntaxKind.NumericLiteralToken:
00417             case SyntaxKind.StringLiteralToken:
00418             case SyntaxKind.CharLiteralToken:
00419             case SyntaxKind.FalseTokenKeyword:
00420             case SyntaxKind.TrueTokenKeyword:
00421                 TypeClauseNode tokenTypeClauseNode;
00422                 
00423                 if (token.SyntaxKind == SyntaxKind.NumericLiteralToken)
00424                     tokenTypeClauseNode = CSharpFacts.Types.Int.ToTypeClause();
00425                 else if (token.SyntaxKind == SyntaxKind.StringLiteralToken)
00426                     tokenTypeClauseNode = CSharpFacts.Types.String.ToTypeClause();
00427                 else if (token.SyntaxKind == SyntaxKind.CharLiteralToken)
00428                     tokenTypeClauseNode = CSharpFacts.Types.Char.ToTypeClause();
00429                 else if (token.SyntaxKind == SyntaxKind.FalseTokenKeyword || token.SyntaxKind == SyntaxKind.TrueTokenKeyword)
00430                     tokenTypeClauseNode = CSharpFacts.Types.Bool.ToTypeClause();
00431                 else
00432                     goto default;
00433                     
00434                 var tokenTypeClauseNodeText = tokenTypeClauseNode.TypeIdentifierToken.TextSpan.GetText();
00435             
00436                 var leftExpressionTypeClauseNodeText = binaryExpressionNode.LeftExpressionNode.ResultTypeClauseNode.TypeIdentifierToken.TextSpan.GetText();
00437                 if (leftExpressionTypeClauseNodeText != tokenTypeClauseNodeText)
00438                     goto default;
00439             
00440                 var rightExpressionNode = new LiteralExpressionNode(token, tokenTypeClauseNode);
00441                 binaryExpressionNode.SetRightExpressionNode(rightExpressionNode);
00442                 return binaryExpressionNode;
00443             case SyntaxKind.PlusToken:
00444             case SyntaxKind.MinusToken:
00445             case SyntaxKind.StarToken:
00446             case SyntaxKind.DivisionToken:
00447             case SyntaxKind.EqualsEqualsToken:
00448                 // TODO: More generally, the result will be a number, so all that matters is what operators a number can interact with instead of duplicating this code.
00449                 if (binaryExpressionNode.RightExpressionNode.SyntaxKind != SyntaxKind.EmptyExpressionNode)
00450                 {
00451                     var typeClauseNode = binaryExpressionNode.ResultTypeClauseNode;
00452                     var binaryOperatorNode = new BinaryOperatorNode(typeClauseNode, token, typeClauseNode, typeClauseNode);
00453                     return new BinaryExpressionNode(binaryExpressionNode, binaryOperatorNode, new EmptyExpressionNode(typeClauseNode));
00454                 }
00455                 else
00456                 {
00457                     goto default;
00458                 }
00459             default:
00460                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), binaryExpressionNode, token);
00461         }
00462     }
