00495     public IExpressionNode ConstructorInvocationMergeToken(
00496         ConstructorInvocationExpressionNode constructorInvocationExpressionNode, ISyntaxToken token, IParserModel model)
00497     {
00498         switch (token.SyntaxKind)
00499         {
00500             case SyntaxKind.IdentifierToken:
00501                 if (constructorInvocationExpressionNode.ResultTypeClauseNode is null)
00502                 {
00503                     if (token.SyntaxKind == SyntaxKind.IdentifierToken ||
00504                         UtilityApi.IsTypeIdentifierKeywordSyntaxKind(token.SyntaxKind))
00505                     {
00506                         var typeClauseNode = new TypeClauseNode(
00507                             token,
00508                             valueType: null,
00509                             genericParametersListingNode: null);
00510                         
00511                         BindTypeClauseNode(
00512                             typeClauseNode,
00513                             (CSharpParserModel)model);
00514                         
00515                         return constructorInvocationExpressionNode.SetTypeClauseNode(typeClauseNode);
00516                     }
00517                 }
00518                 
00519                 goto default;
00520             case SyntaxKind.OpenParenthesisToken:
00521                 var functionParametersListingNode = new FunctionParametersListingNode(
00522                     (OpenParenthesisToken)token,
00523                     new List<FunctionParameterEntryNode>(),
00524                     closeParenthesisToken: default);
00525                     
00526                 constructorInvocationExpressionNode.SetFunctionParametersListingNode(functionParametersListingNode);
00527                 
00528                 constructorInvocationExpressionNode.ConstructorInvocationStageKind = ConstructorInvocationStageKind.FunctionParameters;
00529                 model.ExpressionList.Add((SyntaxKind.CloseParenthesisToken, constructorInvocationExpressionNode));
00530                 model.ExpressionList.Add((SyntaxKind.CommaToken, constructorInvocationExpressionNode.FunctionParametersListingNode));
00531                 return EmptyExpressionNode.Empty;
00532             case SyntaxKind.CloseParenthesisToken:
00533                 if (constructorInvocationExpressionNode.FunctionParametersListingNode is not null)
00534                 {
00535                     constructorInvocationExpressionNode.FunctionParametersListingNode.SetCloseParenthesisToken((CloseParenthesisToken)token);
00536                     return constructorInvocationExpressionNode;
00537                 }
00538                 else
00539                 {
00540                     goto default;
00541                 }
00542             case SyntaxKind.OpenAngleBracketToken:
00543                 if (constructorInvocationExpressionNode.ResultTypeClauseNode.GenericParametersListingNode is null)
00544                 {
00545                     constructorInvocationExpressionNode.ResultTypeClauseNode.SetGenericParametersListingNode(
00546                         new GenericParametersListingNode(
00547                             (OpenAngleBracketToken)token,
00548                             new List<GenericParameterEntryNode>(),
00549                             closeAngleBracketToken: default));
00550                 }
00551                 
00552                 constructorInvocationExpressionNode.ConstructorInvocationStageKind = ConstructorInvocationStageKind.GenericParameters;
00553                 model.ExpressionList.Add((SyntaxKind.CloseAngleBracketToken, constructorInvocationExpressionNode));
00554                 model.ExpressionList.Add((SyntaxKind.CommaToken, constructorInvocationExpressionNode.ResultTypeClauseNode.GenericParametersListingNode));
00555                 return EmptyExpressionNode.Empty;
00556             case SyntaxKind.CloseAngleBracketToken:
00557                 constructorInvocationExpressionNode.ConstructorInvocationStageKind = ConstructorInvocationStageKind.Unset;
00558                 constructorInvocationExpressionNode.ResultTypeClauseNode.GenericParametersListingNode.SetCloseAngleBracketToken((CloseAngleBracketToken)token);
00559                 return constructorInvocationExpressionNode;
00560             case SyntaxKind.OpenBraceToken:
00561                 var objectInitializationParametersListingNode = new ObjectInitializationParametersListingNode(
00562                     (OpenBraceToken)token,
00563                     new List<ObjectInitializationParameterEntryNode>(),
00564                     closeBraceToken: default);
00565                     
00566                 constructorInvocationExpressionNode.SetObjectInitializationParametersListingNode(objectInitializationParametersListingNode);
00567                 
00568                 constructorInvocationExpressionNode.ConstructorInvocationStageKind = ConstructorInvocationStageKind.ObjectInitializationParameters;
00569                 model.ExpressionList.Add((SyntaxKind.CloseBraceToken, constructorInvocationExpressionNode));
00570                 model.ExpressionList.Add((SyntaxKind.EqualsToken, constructorInvocationExpressionNode));
00571                 model.ExpressionList.Add((SyntaxKind.CommaToken, constructorInvocationExpressionNode));
00572                 return EmptyExpressionNode.Empty;
00573             case SyntaxKind.CloseBraceToken:
00574                 constructorInvocationExpressionNode.ConstructorInvocationStageKind = ConstructorInvocationStageKind.Unset;
00575                 
00576                 if (constructorInvocationExpressionNode.ObjectInitializationParametersListingNode is not null)
00577                 {
00578                     constructorInvocationExpressionNode.ObjectInitializationParametersListingNode.SetCloseBraceToken((CloseBraceToken)token);
00579                     return constructorInvocationExpressionNode;
00580                 }
00581                 else
00582                 {
00583                     goto default;
00584                 }
00585             case SyntaxKind.EqualsToken:
00586                 model.ExpressionList.Add((SyntaxKind.EqualsToken, constructorInvocationExpressionNode));
00587                 model.ExpressionList.Add((SyntaxKind.CommaToken, constructorInvocationExpressionNode));
00588                 
00589                 if (constructorInvocationExpressionNode.ConstructorInvocationStageKind == ConstructorInvocationStageKind.ObjectInitializationParameters &&
00590                     constructorInvocationExpressionNode.ObjectInitializationParametersListingNode is not null)
00591                 {
00592                     if (constructorInvocationExpressionNode.ObjectInitializationParametersListingNode.ObjectInitializationParameterEntryNodeList.Count > 0)
00593                     {
00594                         var lastParameter = constructorInvocationExpressionNode.ObjectInitializationParametersListingNode.ObjectInitializationParameterEntryNodeList.Last();
00595                         
00596                         if (!lastParameter.EqualsToken.ConstructorWasInvoked)
00597                         {
00598                             lastParameter.EqualsToken = (EqualsToken)token;
00599                             return EmptyExpressionNode.Empty;
00600                         }
00601                     }
00602                 }
00603                 
00604                 goto default;
00605             case SyntaxKind.CommaToken:
00606                 model.ExpressionList.Add((SyntaxKind.CommaToken, constructorInvocationExpressionNode));
00607                 return EmptyExpressionNode.Empty;
00608             default:
00609                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), constructorInvocationExpressionNode, token);
00610         }
00611     }
