00613     public IExpressionNode ConstructorInvocationMergeExpression(
00614         ConstructorInvocationExpressionNode constructorInvocationExpressionNode, IExpressionNode expressionSecondary, IParserModel model)
00615     {
00616         if (constructorInvocationExpressionNode.ConstructorInvocationStageKind != ConstructorInvocationStageKind.ObjectInitializationParameters &&
00617             expressionSecondary.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
00618         {
00619             expressionSecondary = ForceDecisionAmbiguousIdentifier(
00620                 constructorInvocationExpressionNode,
00621                 (AmbiguousIdentifierExpressionNode)expressionSecondary,
00622                 model);
00623         }
00624     
00625         if (expressionSecondary.SyntaxKind == SyntaxKind.EmptyExpressionNode)
00626         {
00627             return constructorInvocationExpressionNode;
00628         }
00629         else if (constructorInvocationExpressionNode.ConstructorInvocationStageKind == ConstructorInvocationStageKind.GenericParameters &&
00630                  constructorInvocationExpressionNode.ResultTypeClauseNode.GenericParametersListingNode is not null)
00631         {
00632             return constructorInvocationExpressionNode;
00633         }
00634         else if (constructorInvocationExpressionNode.ConstructorInvocationStageKind == ConstructorInvocationStageKind.FunctionParameters &&
00635                  constructorInvocationExpressionNode.FunctionParametersListingNode is not null)
00636         {
00637             return constructorInvocationExpressionNode;
00638         }
00639         else if (constructorInvocationExpressionNode.ConstructorInvocationStageKind == ConstructorInvocationStageKind.ObjectInitializationParameters &&
00640                  constructorInvocationExpressionNode.ObjectInitializationParametersListingNode is not null)
00641         {
00642             var needNewNode = true;
00643             ObjectInitializationParameterEntryNode? objectInitializationParameterEntryNode = null;
00644             
00645             if (constructorInvocationExpressionNode.ObjectInitializationParametersListingNode.ObjectInitializationParameterEntryNodeList.Count > 0)
00646             {
00647                 objectInitializationParameterEntryNode = constructorInvocationExpressionNode.ObjectInitializationParametersListingNode.ObjectInitializationParameterEntryNodeList.Last();
00648                 
00649                 if (!objectInitializationParameterEntryNode.PropertyIdentifierToken.ConstructorWasInvoked ||
00650                     (objectInitializationParameterEntryNode.ExpressionNode.SyntaxKind == SyntaxKind.EmptyExpressionNode))
00651                 {
00652                     needNewNode = false;
00653                 }
00654             }
00655             
00656             if (needNewNode)
00657             {
00658                 objectInitializationParameterEntryNode = new ObjectInitializationParameterEntryNode(
00659                     propertyIdentifierToken: default,
00660                     equalsToken: default,
00661                     expressionNode: EmptyExpressionNode.Empty);
00662                 
00663                 constructorInvocationExpressionNode.ObjectInitializationParametersListingNode.ObjectInitializationParameterEntryNodeList.Add(objectInitializationParameterEntryNode);
00664             }
00665             
00666             var success = true;
00667             
00668             // I'm tired and feel like I'm about to pass out.
00669             // This feels like hacky nonsense.
00670             // It allows for ObjectInitialization and CollectionInitialization
00671             // to use the same node but why not just use separate nodes?
00672             var currentTokenIsComma = model.TokenWalker.Current.SyntaxKind == SyntaxKind.CommaToken;
00673             var currentTokenIsBrace = model.TokenWalker.Current.SyntaxKind == SyntaxKind.CloseBraceToken;
00674 
00675             if (!objectInitializationParameterEntryNode.PropertyIdentifierToken.ConstructorWasInvoked &&
00676                 (!currentTokenIsComma && !currentTokenIsBrace))
00677             {
00678                 if (expressionSecondary.SyntaxKind == SyntaxKind.VariableReferenceNode)
00679                 {
00680                     objectInitializationParameterEntryNode.PropertyIdentifierToken = ((VariableReferenceNode)expressionSecondary).VariableIdentifierToken;
00681                 }
00682                 else if (expressionSecondary.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
00683                 {
00684                     var ambiguousIdentifierExpressionNode = (AmbiguousIdentifierExpressionNode)expressionSecondary;
00685                     if (ambiguousIdentifierExpressionNode.Token.SyntaxKind == SyntaxKind.IdentifierToken)
00686                     {
00687                         objectInitializationParameterEntryNode.PropertyIdentifierToken = (IdentifierToken)ambiguousIdentifierExpressionNode.Token;
00688                     }
00689                     else
00690                     {
00691                         success = false;
00692                     }
00693                 }
00694                 else if (expressionSecondary.SyntaxKind == SyntaxKind.TypeClauseNode)
00695                 {
00696                     var typeClauseNode = (TypeClauseNode)expressionSecondary;
00697                     objectInitializationParameterEntryNode.PropertyIdentifierToken = (IdentifierToken)typeClauseNode.TypeIdentifierToken;
00698                 }
00699                 else
00700                 {
00701                     success = false;
00702                 }
00703             }
00704             else if (!objectInitializationParameterEntryNode.EqualsToken.ConstructorWasInvoked &&
00705                      (!currentTokenIsComma && !currentTokenIsBrace))
00706             {
00707                 success = false;
00708             }
00709             else if (objectInitializationParameterEntryNode.ExpressionNode.SyntaxKind == SyntaxKind.EmptyExpressionNode)
00710             {
00711                 if (expressionSecondary.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
00712                 {
00713                     expressionSecondary = ForceDecisionAmbiguousIdentifier(
00714                         constructorInvocationExpressionNode,
00715                         (AmbiguousIdentifierExpressionNode)expressionSecondary,
00716                         model);
00717                 }
00718             
00719                 objectInitializationParameterEntryNode.ExpressionNode = expressionSecondary;
00720                 
00721                 if (!objectInitializationParameterEntryNode.EqualsToken.ConstructorWasInvoked && (currentTokenIsComma || currentTokenIsBrace))
00722                 {
00723                     var nextObjectInitializationParameterEntryNode = new ObjectInitializationParameterEntryNode(
00724                         propertyIdentifierToken: default,
00725                         equalsToken: default,
00726                         expressionNode: EmptyExpressionNode.Empty);
00727                     
00728                     constructorInvocationExpressionNode.ObjectInitializationParametersListingNode.ObjectInitializationParameterEntryNodeList.Add(nextObjectInitializationParameterEntryNode);
00729                 }
00730             }
00731             else
00732             {
00733                 success = false;
00734             }
00735             
00736             if (success)
00737             {
00738                 return constructorInvocationExpressionNode;
00739             }
00740             else
00741             {
00742                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), constructorInvocationExpressionNode, expressionSecondary);
00743             }
00744         }
00745         
00746         return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), constructorInvocationExpressionNode, expressionSecondary);
00747     }
