00749     public IExpressionNode EmptyMergeToken(
00750         EmptyExpressionNode emptyExpressionNode, ISyntaxToken token, IParserModel model)
00751     {
00752         if (UtilityApi.IsConvertibleToTypeClauseNode(token.SyntaxKind))
00753         {
00754             var ambiguousExpressionNode = new AmbiguousIdentifierExpressionNode(
00755                 token,
00756                 genericParametersListingNode: null,
00757                 CSharpFacts.Types.Void.ToTypeClause())
00758             {
00759                 FollowsMemberAccessToken = emptyExpressionNode.FollowsMemberAccessToken
00760             };
00761             
00762             if (model.TokenWalker.Next.SyntaxKind == SyntaxKind.StatementDelimiterToken && !ambiguousExpressionNode.FollowsMemberAccessToken ||
00763                 model.TryParseExpressionSyntaxKindList.Contains(SyntaxKind.TypeClauseNode) && model.TokenWalker.Next.SyntaxKind != SyntaxKind.WithTokenContextualKeyword)
00764             {
00765                 return ForceDecisionAmbiguousIdentifier(
00766                     emptyExpressionNode,
00767                     ambiguousExpressionNode,
00768                     model);
00769             }
00770             
00771             return ambiguousExpressionNode;
00772         }
00773     
00774         switch (token.SyntaxKind)
00775         {
00776             case SyntaxKind.NumericLiteralToken:
00777             case SyntaxKind.StringLiteralToken:
00778             case SyntaxKind.CharLiteralToken:
00779             case SyntaxKind.FalseTokenKeyword:
00780             case SyntaxKind.TrueTokenKeyword:           
00781                 TypeClauseNode tokenTypeClauseNode;
00782                 
00783                 if (token.SyntaxKind == SyntaxKind.NumericLiteralToken)
00784                     tokenTypeClauseNode = CSharpFacts.Types.Int.ToTypeClause();
00785                 else if (token.SyntaxKind == SyntaxKind.StringLiteralToken)
00786                     tokenTypeClauseNode = CSharpFacts.Types.String.ToTypeClause();
00787                 else if (token.SyntaxKind == SyntaxKind.CharLiteralToken)
00788                     tokenTypeClauseNode = CSharpFacts.Types.Char.ToTypeClause();
00789                 else if (token.SyntaxKind == SyntaxKind.FalseTokenKeyword || token.SyntaxKind == SyntaxKind.TrueTokenKeyword)
00790                     tokenTypeClauseNode = CSharpFacts.Types.Bool.ToTypeClause();
00791                 else
00792                     goto default;
00793                     
00794                 return new LiteralExpressionNode(token, tokenTypeClauseNode);
00795             case SyntaxKind.OpenParenthesisToken:
00796                 var parenthesizedExpressionNode = new ParenthesizedExpressionNode((OpenParenthesisToken)token, CSharpFacts.Types.Void.ToTypeClause());
00797                 model.ExpressionList.Add((SyntaxKind.CloseParenthesisToken, parenthesizedExpressionNode));
00798                 model.ExpressionList.Add((SyntaxKind.CommaToken, parenthesizedExpressionNode));
00799                 return EmptyExpressionNode.Empty;
00800             case SyntaxKind.NewTokenKeyword:
00801                 return new ConstructorInvocationExpressionNode(
00802                     (KeywordToken)token,
00803                     typeClauseNode: null,
00804                     functionParametersListingNode: null,
00805                     objectInitializationParametersListingNode: null);
00806             case SyntaxKind.AsyncTokenContextualKeyword:
00807                 return new LambdaExpressionNode(CSharpFacts.Types.Void.ToTypeClause());
00808             case SyntaxKind.DollarSignToken:
00809                 BindStringInterpolationExpression((DollarSignToken)token, (CSharpParserModel)model);
00810                 return emptyExpressionNode;
00811             case SyntaxKind.AtToken:
00812                 BindStringVerbatimExpression((AtToken)token, (CSharpParserModel)model);
00813                 return emptyExpressionNode;
00814             case SyntaxKind.OutTokenKeyword:
00815                 
00816                 if (UtilityApi.IsConvertibleToIdentifierToken(model.TokenWalker.Current.SyntaxKind))
00817                 {
00818                     // Parse the variable reference / variable declaration
00819                     ParseTokens.ParseIdentifierToken((CSharpParserModel)model);
00820                 }
00821                 
00822                 return emptyExpressionNode;
00823             case SyntaxKind.InTokenKeyword:
00824             case SyntaxKind.RefTokenKeyword:
00825                 return emptyExpressionNode;
00826             case SyntaxKind.OpenAngleBracketToken:
00827                 var genericParametersListingNode = new GenericParametersListingNode(
00828                     (OpenAngleBracketToken)token,
00829                     new List<GenericParameterEntryNode>(),
00830                     closeAngleBracketToken: default);
00831                 
00832                 model.ExpressionList.Add((SyntaxKind.CloseAngleBracketToken, genericParametersListingNode));    
00833                 model.ExpressionList.Add((SyntaxKind.CommaToken, genericParametersListingNode));
00834                 return EmptyExpressionNode.Empty;
00835             default:
00836                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), emptyExpressionNode, token);
00837         }
00838     }
