00858     public IExpressionNode GenericParametersListingMergeToken(
00859         GenericParametersListingNode genericParametersListingNode, ISyntaxToken token, IParserModel model)
00860     {
00861         switch (token.SyntaxKind)
00862         {
00863             case SyntaxKind.CommaToken:
00864                 model.ExpressionList.Add((SyntaxKind.CommaToken, genericParametersListingNode));
00865                 return EmptyExpressionNode.Empty;
00866             case SyntaxKind.CloseAngleBracketToken:
00867                 // This case only occurs when the text won't compile.
00868                 // i.e.: "<int>" rather than "MyClass<int>".
00869                 // The case is for when the user types just the generic parameter listing text without an identifier before it.
00870                 //
00871                 // In the case of "SomeMethod<int>()", the FunctionInvocationNode
00872                 // is expected to have ran 'model.ExpressionList.Add((SyntaxKind.CloseAngleBracketToken, functionInvocationNode));'
00873                 // to receive the genericParametersListingNode.
00874                 return genericParametersListingNode;
00875             default:
00876                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), genericParametersListingNode, token);
00877         }
00878     }
