00880     public IExpressionNode GenericParametersListingMergeExpression(
00881         GenericParametersListingNode genericParametersListingNode, IExpressionNode expressionSecondary, IParserModel model)
00882     {
00883         if (expressionSecondary.SyntaxKind == SyntaxKind.EmptyExpressionNode)
00884             return genericParametersListingNode;
00885     
00886         if (expressionSecondary.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
00887         {
00888             var expressionSecondaryTyped = (AmbiguousIdentifierExpressionNode)expressionSecondary;
00889             
00890             var typeClauseNode = new TypeClauseNode(
00891                 expressionSecondaryTyped.Token,
00892                 valueType: null,
00893                 genericParametersListingNode: null);
00894             
00895             BindTypeClauseNode(
00896                 typeClauseNode,
00897                 (CSharpParserModel)model);
00898             
00899             genericParametersListingNode.GenericParameterEntryNodeList.Add(
00900                 new GenericParameterEntryNode(typeClauseNode));
00901             
00902             return genericParametersListingNode;
00903         }
00904         else if (expressionSecondary.SyntaxKind == SyntaxKind.TypeClauseNode)
00905         {
00906             var typeClauseNode = (TypeClauseNode)expressionSecondary;
00907         
00908             genericParametersListingNode.GenericParameterEntryNodeList.Add(
00909                 new GenericParameterEntryNode(typeClauseNode));
00910             
00911             return genericParametersListingNode;
00912         }
00913         else if (expressionSecondary.SyntaxKind == SyntaxKind.BadExpressionNode)
00914         {
00915             var badExpressionNode = (BadExpressionNode)expressionSecondary;
00916         
00917             if (badExpressionNode.SyntaxList.Count == 2 &&
00918                     (badExpressionNode.SyntaxList[1].SyntaxKind == SyntaxKind.TypeClauseNode ||
00919                      UtilityApi.IsTypeIdentifierKeywordSyntaxKind(badExpressionNode.SyntaxList[1].SyntaxKind)))
00920             {
00921                 var typeClauseNode = (TypeClauseNode)badExpressionNode.SyntaxList[1];
00922                 
00923                 BindTypeClauseNode(
00924                     typeClauseNode,
00925                     (CSharpParserModel)model);
00926                 
00927                 genericParametersListingNode.GenericParameterEntryNodeList.Add(
00928                     new GenericParameterEntryNode(typeClauseNode));
00929                 
00930                 return genericParametersListingNode;
00931             }
00932         }
00933         
00934         return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), genericParametersListingNode, expressionSecondary);
00935     }
