01016     public IExpressionNode LambdaMergeToken(
01017         LambdaExpressionNode lambdaExpressionNode, ISyntaxToken token, IParserModel model)
01018     {
01019         if (token.SyntaxKind == SyntaxKind.CloseAngleBracketToken)
01020         {
01021             int startInclusiveIndex;
01022             
01023             if (model.TokenWalker.Previous.SyntaxKind == SyntaxKind.EqualsToken)
01024                 startInclusiveIndex = model.TokenWalker.Previous.TextSpan.StartingIndexInclusive;
01025             else
01026                 startInclusiveIndex = token.TextSpan.StartingIndexInclusive;
01027             
01028             var endExclusiveIndex = token.TextSpan.EndingIndexExclusive;
01029             
01030             var textSpan = new TextEditorTextSpan(
01031                 startInclusiveIndex,
01032                 endExclusiveIndex,
01033                 (byte)GenericDecorationKind.None,
01034                 token.TextSpan.ResourceUri,
01035                 token.TextSpan.SourceText);
01036         
01037             ((CSharpBinder)model.Binder).AddSymbolDefinition(
01038                 new LambdaSymbol(textSpan, lambdaExpressionNode), (CSharpParserModel)model);
01039         
01040             if (model.TokenWalker.Next.SyntaxKind == SyntaxKind.OpenBraceToken)
01041             {
01042                 lambdaExpressionNode.CodeBlockNodeIsExpression = false;
01043             
01044                 model.ExpressionList.Add((SyntaxKind.CloseBraceToken, lambdaExpressionNode));
01045                 model.ExpressionList.Add((SyntaxKind.StatementDelimiterToken, lambdaExpressionNode));
01046                 return EmptyExpressionNode.Empty;
01047             }
01048             
01049             model.ExpressionList.Add((SyntaxKind.StatementDelimiterToken, lambdaExpressionNode));
01050             return EmptyExpressionNode.Empty;
01051         }
01052         else if (token.SyntaxKind == SyntaxKind.StatementDelimiterToken)
01053         {
01054             if (lambdaExpressionNode.CodeBlockNodeIsExpression)
01055             {
01056                 return lambdaExpressionNode;
01057             }
01058             else
01059             {
01060                 model.ExpressionList.Add((SyntaxKind.StatementDelimiterToken, lambdaExpressionNode));
01061                 return EmptyExpressionNode.Empty;
01062             }
01063         }
01064         else if (token.SyntaxKind == SyntaxKind.CloseBraceToken)
01065         {
01066             if (lambdaExpressionNode.CodeBlockNodeIsExpression)
01067             {
01068                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), lambdaExpressionNode, token);
01069             }
01070             else
01071             {
01072                 return lambdaExpressionNode;
01073             }
01074         }
01075         else if (token.SyntaxKind == SyntaxKind.OpenParenthesisToken)
01076         {
01077             if (lambdaExpressionNode.HasReadParameters)
01078             {
01079                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), lambdaExpressionNode, token);
01080             }
01081             else
01082             {
01083                 lambdaExpressionNode.HasReadParameters = true;
01084                 model.ExpressionList.Add((SyntaxKind.CloseParenthesisToken, lambdaExpressionNode));
01085                 model.ExpressionList.Add((SyntaxKind.CommaToken, lambdaExpressionNode));
01086                 return EmptyExpressionNode.Empty;
01087             }
01088         }
01089         else if (token.SyntaxKind == SyntaxKind.CloseParenthesisToken)
01090         {
01091             return lambdaExpressionNode;
01092         }
01093         else if (token.SyntaxKind == SyntaxKind.EqualsToken)
01094         {
01095             if (model.TokenWalker.Next.SyntaxKind == SyntaxKind.CloseAngleBracketToken)
01096                 return lambdaExpressionNode;
01097             
01098             return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), lambdaExpressionNode, token);
01099         }
01100         else if (token.SyntaxKind == SyntaxKind.CommaToken)
01101         {
01102             model.ExpressionList.Add((SyntaxKind.CommaToken, lambdaExpressionNode));
01103             return EmptyExpressionNode.Empty;
01104         }
01105         else if (token.SyntaxKind == SyntaxKind.IdentifierToken)
01106         {
01107             if (lambdaExpressionNode.HasReadParameters)
01108             {
01109                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), lambdaExpressionNode, token);
01110             }
01111             else
01112             {
01113                 lambdaExpressionNode.HasReadParameters = true;
01114                 return lambdaExpressionNode;
01115             }
01116         }
01117         else
01118         {
01119             return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), lambdaExpressionNode, token);
01120         }
01121     }
