01141     public IExpressionNode LiteralMergeToken(
01142         LiteralExpressionNode literalExpressionNode, ISyntaxToken token, IParserModel model)
01143     {
01144         switch (token.SyntaxKind)
01145         {
01146             case SyntaxKind.PlusToken:
01147             case SyntaxKind.MinusToken:
01148             case SyntaxKind.StarToken:
01149             case SyntaxKind.DivisionToken:
01150             case SyntaxKind.EqualsEqualsToken:
01151                 var typeClauseNode = literalExpressionNode.ResultTypeClauseNode;
01152                 var binaryOperatorNode = new BinaryOperatorNode(typeClauseNode, token, typeClauseNode, typeClauseNode);
01153                 return new BinaryExpressionNode(literalExpressionNode, binaryOperatorNode);
01154             default:
01155                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), literalExpressionNode, token);
01156         }
