01159     public IExpressionNode ParenthesizedMergeToken(
01160         ParenthesizedExpressionNode parenthesizedExpressionNode, ISyntaxToken token, IParserModel model)
01161     {
01162         switch (token.SyntaxKind)
01163         {
01164             case SyntaxKind.CloseParenthesisToken:
01165                 if (parenthesizedExpressionNode.InnerExpression.SyntaxKind == SyntaxKind.TypeClauseNode)
01166                 {
01167                     var typeClauseNode = (TypeClauseNode)parenthesizedExpressionNode.InnerExpression;
01168                     var explicitCastNode = new ExplicitCastNode(parenthesizedExpressionNode.OpenParenthesisToken, typeClauseNode);
01169                     return ExplicitCastMergeToken(explicitCastNode, token, model);
01170                 }
01171                 
01172                 return parenthesizedExpressionNode.SetCloseParenthesisToken((CloseParenthesisToken)token);
01173             case SyntaxKind.EqualsToken:
01174                 if (model.TokenWalker.Next.SyntaxKind == SyntaxKind.CloseAngleBracketToken)
01175                 {
01176                     var lambdaExpressionNode = new LambdaExpressionNode(CSharpFacts.Types.Void.ToTypeClause());
01177                     SetLambdaExpressionNodeVariableDeclarationNodeList(lambdaExpressionNode, parenthesizedExpressionNode.InnerExpression, model);
01178                     return lambdaExpressionNode;
01179                 }
01180                 
01181                 return parenthesizedExpressionNode;
01182             default:
01183                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), parenthesizedExpressionNode, token);
01184         }
01185     }
01186     
01187     public IExpressionNode ParenthesizedMergeExpression(
01188         ParenthesizedExpressionNode parenthesizedExpressionNode, IExpressionNode expressionSecondary, IParserModel model)
01189     {
01190         if (model.TokenWalker.Peek(1).SyntaxKind == SyntaxKind.EqualsToken &&
01191             model.TokenWalker.Peek(2).SyntaxKind == SyntaxKind.CloseAngleBracketToken)
01192         {
01193             var lambdaExpressionNode = new LambdaExpressionNode(CSharpFacts.Types.Void.ToTypeClause());
01194             return SetLambdaExpressionNodeVariableDeclarationNodeList(lambdaExpressionNode, expressionSecondary, model);
01195         }
01196     
01197         if (expressionSecondary.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
01198             expressionSecondary = ForceDecisionAmbiguousIdentifier(parenthesizedExpressionNode, (AmbiguousIdentifierExpressionNode)expressionSecondary, model);
01199     
01200         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.CommaToken)
01201         {
01202             model.NoLongerRelevantExpressionNode = parenthesizedExpressionNode;
01203             var commaSeparatedExpressionNode = new CommaSeparatedExpressionNode();
01204             commaSeparatedExpressionNode.AddInnerExpressionNode(expressionSecondary);
01205             // commaSeparatedExpressionNode never saw the 'OpenParenthesisToken' so the 'ParenthesizedExpressionNode
01206             // has to create the ExpressionList entry on behalf of the 'CommaSeparatedExpressionNode'.
01207             model.ExpressionList.Add((SyntaxKind.CloseParenthesisToken, commaSeparatedExpressionNode));
01208             return commaSeparatedExpressionNode; 
01209         }
01210     
01211         if (parenthesizedExpressionNode.InnerExpression.SyntaxKind != SyntaxKind.EmptyExpressionNode)
01212             return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), parenthesizedExpressionNode, expressionSecondary);
01213         
01214         // TODO: This seems like a bad idea?
01215         if (expressionSecondary.SyntaxKind == SyntaxKind.VariableReferenceNode)
01216         {
01217              var variableReferenceNode = (VariableReferenceNode)expressionSecondary;
01218              
01219              if (variableReferenceNode.IsFabricated)
01220              {
01221                 var typeClauseNode = new TypeClauseNode(variableReferenceNode.VariableIdentifierToken, valueType: null, genericParametersListingNode: null);
01222                 
01223                 BindTypeClauseNode(
01224                     typeClauseNode,
01225                     (CSharpParserModel)model);
01226                     
01227                 return new ExplicitCastNode(parenthesizedExpressionNode.OpenParenthesisToken, typeClauseNode);
01228              }
01229         }
01230 
01231         return parenthesizedExpressionNode.SetInnerExpression(expressionSecondary);
01232     }
01233     
01234     public IExpressionNode TypeClauseMergeToken(
01235         TypeClauseNode typeClauseNode, ISyntaxToken token, IParserModel model)
01236     {
01237         switch (token.SyntaxKind)
01238         {
01239             case SyntaxKind.OpenAngleBracketToken:
01240                 if (typeClauseNode.GenericParametersListingNode is null)
01241                 {
01242                     typeClauseNode.SetGenericParametersListingNode(
01243                         new GenericParametersListingNode(
01244                             (OpenAngleBracketToken)token,
01245                             new List<GenericParameterEntryNode>(),
01246                             closeAngleBracketToken: default));
01247                 }
01248                 
01249                 model.ExpressionList.Add((SyntaxKind.CloseAngleBracketToken, typeClauseNode));
01250                 model.ExpressionList.Add((SyntaxKind.CommaToken, typeClauseNode.GenericParametersListingNode));
01251                 return EmptyExpressionNode.Empty;
01252             case SyntaxKind.CloseAngleBracketToken:
01253                 if (typeClauseNode.GenericParametersListingNode is not null)
01254                 {
01255                     typeClauseNode.GenericParametersListingNode.SetCloseAngleBracketToken((CloseAngleBracketToken)token);
01256                     return typeClauseNode;
01257                 }
01258                 
01259                 goto default;
01260             case SyntaxKind.QuestionMarkToken:
01261                 if (!typeClauseNode.HasQuestionMark)
01262                 {
01263                     typeClauseNode.HasQuestionMark = true;
01264                     return typeClauseNode;
01265                 }
01266                 
01267                 goto default;
01268             case SyntaxKind.OpenParenthesisToken:
01269                 if (token.SyntaxKind == SyntaxKind.OpenParenthesisToken &&
01270                     UtilityApi.IsConvertibleToIdentifierToken(typeClauseNode.TypeIdentifierToken.SyntaxKind))
01271                 {
01272                     var functionParametersListingNode = new FunctionParametersListingNode(
01273                         (OpenParenthesisToken)token,
01274                         new List<FunctionParameterEntryNode>(),
01275                         closeParenthesisToken: default);
01276                 
01277                     var functionInvocationNode = new FunctionInvocationNode(
01278                         UtilityApi.ConvertToIdentifierToken(typeClauseNode.TypeIdentifierToken, model),
01279                         functionDefinitionNode: null,
01280                         typeClauseNode.GenericParametersListingNode,
01281                         functionParametersListingNode,
01282                         CSharpFacts.Types.Void.ToTypeClause());
01283                         
01284                     BindFunctionInvocationNode(
01285                         functionInvocationNode,
01286                         (CSharpParserModel)model);
01287         
01288                     model.ExpressionList.Add((SyntaxKind.CloseParenthesisToken, functionInvocationNode));
01289                     model.ExpressionList.Add((SyntaxKind.CommaToken, functionInvocationNode.FunctionParametersListingNode));
01290                     return EmptyExpressionNode.Empty;
01291                 }
01292                 
01293                 goto default;
01294             case SyntaxKind.WithTokenContextualKeyword:
01295                 Console.WriteLine("case SyntaxKind.WithTokenContextualKeyword)");
01296                 goto default;
01297             default:
01298                 if (UtilityApi.IsConvertibleToIdentifierToken(token.SyntaxKind))
01299                 {
01300                     var identifierToken = UtilityApi.ConvertToIdentifierToken(token, model);
01301                     var isRootExpression = true;
01302                     
01303                     foreach (var tuple in model.ExpressionList)
01304                     {
01305                         if (tuple.ExpressionNode is null)
01306                             continue;
01307                         
01308                         isRootExpression = false;
01309                         break;
01310                     }
01311                     
01312                     IVariableDeclarationNode variableDeclarationNode;
01313                     
01314                     if (isRootExpression)
01315                     {
01316                         // If isRootExpression do not bind the VariableDeclarationNode
01317                         // because it could in reality be a FunctionDefinitionNode.
01318                         //
01319                         // So, manually create the node, and then eventually return back to the
01320                         // statement code so it can check for a FunctionDefinitionNode.
01321                         //
01322                         // If it truly is a VariableDeclarationNode,
01323                         // then it is the responsibility of the statement code
01324                         // to bind the VariableDeclarationNode, and add it to the current code block builder.
01325                         variableDeclarationNode = new VariableDeclarationNode(
01326                             typeClauseNode,
01327                             identifierToken,
01328                             VariableKind.Local,
01329                             false);
01330                     }
01331                     else
01332                     {
01333                         variableDeclarationNode = ParseVariables.HandleVariableDeclarationExpression(
01334                             typeClauseNode,
01335                             identifierToken,
01336                             VariableKind.Local,
01337                             model);
01338                     }
01339                         
01340                     return variableDeclarationNode;
01341                 }
01342                 
01343                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), typeClauseNode, token);
01344         }
01345     }
01346     
01347     public IExpressionNode TypeClauseMergeExpression(
01348         TypeClauseNode typeClauseNode, IExpressionNode expressionSecondary, IParserModel model)
01349     {
01350         switch (expressionSecondary.SyntaxKind)
01351         {
01352             case SyntaxKind.GenericParametersListingNode:
01353                 if (typeClauseNode.GenericParametersListingNode is not null &&
01354                     !typeClauseNode.GenericParametersListingNode.CloseAngleBracketToken.ConstructorWasInvoked)
01355                 {
01356                     return typeClauseNode;
01357                 }
01358                 
01359                 goto default;
01360             default:
01361                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), typeClauseNode, expressionSecondary);
01362         }
01363     }
