01371     public IExpressionNode VariableAssignmentMergeExpression(
01372         VariableAssignmentExpressionNode variableAssignmentNode, IExpressionNode expressionSecondary, IParserModel model)
01373     {
01374         if (variableAssignmentNode.ExpressionNode == EmptyExpressionNode.Empty)
01375         {
01376             variableAssignmentNode.SetExpressionNode(expressionSecondary);
01377             return variableAssignmentNode;
01378         }
01379         else
01380         {
01381             return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), variableAssignmentNode, expressionSecondary);
01382         }
01383     }
01384     
01385     public IExpressionNode FunctionInvocationMergeToken(
01386         FunctionInvocationNode functionInvocationNode, ISyntaxToken token, IParserModel model)
01387     {
01388         switch (token.SyntaxKind)
01389         {
01390             case SyntaxKind.CloseParenthesisToken:
01391                 functionInvocationNode.FunctionParametersListingNode.SetCloseParenthesisToken((CloseParenthesisToken)token);
01392                 return functionInvocationNode;
01393             default:
01394                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), functionInvocationNode, token);
01395         }
01396     }
01397     
01398     public IExpressionNode FunctionInvocationMergeExpression(
01399         FunctionInvocationNode functionInvocationNode, IExpressionNode expressionSecondary, IParserModel model)
01400     {
01401         if (expressionSecondary.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
01402         {
01403             expressionSecondary = ForceDecisionAmbiguousIdentifier(functionInvocationNode, (AmbiguousIdentifierExpressionNode)expressionSecondary, model);
01404         }
01405     
01406         switch (expressionSecondary.SyntaxKind)
01407         {
01408             case SyntaxKind.EmptyExpressionNode:
01409                 return functionInvocationNode;
01410             case SyntaxKind.FunctionParametersListingNode:
01411                 return functionInvocationNode;
01412             default:
01413                 return new BadExpressionNode(CSharpFacts.Types.Void.ToTypeClause(), functionInvocationNode, expressionSecondary);
01414         }
01415     }
01416     
01417     public IExpressionNode SetLambdaExpressionNodeVariableDeclarationNodeList(
01418         LambdaExpressionNode lambdaExpressionNode, IExpressionNode expressionNode, IParserModel model)
01419     {
01420         if (expressionNode.SyntaxKind == SyntaxKind.BadExpressionNode)
01421         {
01422             var badExpressionNode = (BadExpressionNode)expressionNode;
01423         
01424             if (badExpressionNode.SyntaxList.Count == 2 &&
01425                 badExpressionNode.SyntaxList[0].SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode &&
01426                 badExpressionNode.SyntaxList[1].SyntaxKind == SyntaxKind.IdentifierToken)
01427             {
01428                 var ambiguousIdentifierExpressionNode = (AmbiguousIdentifierExpressionNode)badExpressionNode.SyntaxList[0];
01429                 var typeClauseNode = new TypeClauseNode(ambiguousIdentifierExpressionNode.Token, valueType: null, genericParametersListingNode: null);
01430                     
01431                 BindTypeClauseNode(
01432                     typeClauseNode,
01433                     (CSharpParserModel)model);
01434                 
01435                 var identifierToken = (IdentifierToken)badExpressionNode.SyntaxList[1];
01436                 
01437                 var variableDeclarationNode = ParseVariables.HandleVariableDeclarationExpression(
01438                     typeClauseNode,
01439                     identifierToken,
01440                     VariableKind.Local,
01441                     model);
01442                     
01443                 lambdaExpressionNode.AddVariableDeclarationNode(variableDeclarationNode);
01444             }
01445             else
01446             {
01447                 var typeClauseNode = TypeFacts.Empty.ToTypeClause();
01448                 ISyntaxToken variableIdentifier = default(IdentifierToken);
01449             
01450                 for (int i = 0; i < badExpressionNode.SyntaxList.Count; i++)
01451                 {
01452                     var firstSyntax = badExpressionNode.SyntaxList[i];
01453                     
01454                     var wasTyped = false;
01455                     
01456                     if (firstSyntax.SyntaxKind != SyntaxKind.AmbiguousIdentifierExpressionNode &&
01457                         firstSyntax.SyntaxKind != SyntaxKind.IdentifierToken)
01458                     {
01459                         continue;
01460                     }
01461                     
01462                     if (i < badExpressionNode.SyntaxList.Count - 1 &&
01463                             (badExpressionNode.SyntaxList[i + 1].SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode ||
01464                             badExpressionNode.SyntaxList[i + 1].SyntaxKind == SyntaxKind.IdentifierToken))
01465                     {
01466                         wasTyped = true;
01467                         
01468                         if (firstSyntax.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
01469                         {
01470                             var ambiguousIdentifierExpressionNode = (AmbiguousIdentifierExpressionNode)firstSyntax;
01471                             typeClauseNode = new TypeClauseNode(ambiguousIdentifierExpressionNode.Token, valueType: null, genericParametersListingNode: null);
01472                     
01473                             BindTypeClauseNode(
01474                                 typeClauseNode,
01475                                 (CSharpParserModel)model);
01476                         }
01477                         else if (firstSyntax.SyntaxKind == SyntaxKind.IdentifierToken)
01478                         {
01479                             var identifierToken = (IdentifierToken)firstSyntax;
01480                             typeClauseNode = new TypeClauseNode(identifierToken, valueType: null, genericParametersListingNode: null);
01481                     
01482                             BindTypeClauseNode(
01483                                 typeClauseNode,
01484                                 (CSharpParserModel)model);
01485                         }
01486                         
01487                         var secondSyntax = badExpressionNode.SyntaxList[++i];
01488                         
01489                         if (secondSyntax.SyntaxKind == SyntaxKind.IdentifierToken)
01490                         {
01491                             variableIdentifier = (IdentifierToken)secondSyntax;
01492                         }
01493                         else if (secondSyntax.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
01494                         {
01495                             var token = ((AmbiguousIdentifierExpressionNode)secondSyntax).Token;
01496         
01497                             if (token.SyntaxKind != SyntaxKind.IdentifierToken)
01498                                 continue;
01499                         }
01500                     }
01501                     
01502                     if (!wasTyped)
01503                     {
01504                         typeClauseNode = TypeFacts.Empty.ToTypeClause();
01505                         
01506                         if (firstSyntax.SyntaxKind == SyntaxKind.IdentifierToken)
01507                         {
01508                             variableIdentifier = (IdentifierToken)firstSyntax;
01509                         }
01510                         else if (firstSyntax.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
01511                         {
01512                             var token = ((AmbiguousIdentifierExpressionNode)firstSyntax).Token;
01513         
01514                             if (token.SyntaxKind != SyntaxKind.IdentifierToken)
01515                                 continue;
01516                         }
01517                     }
01518                     
01519                     if (variableIdentifier.SyntaxKind != SyntaxKind.IdentifierToken)
01520                         continue;
01521                     
01522                     var variableDeclarationNode = ParseVariables.HandleVariableDeclarationExpression(
01523                         typeClauseNode,
01524                         (IdentifierToken)variableIdentifier,
01525                         VariableKind.Local,
01526                         model);
01527                         
01528                     lambdaExpressionNode.AddVariableDeclarationNode(variableDeclarationNode);
01529                 }
01530             }
01531         }
01532         else if (expressionNode.SyntaxKind == SyntaxKind.AmbiguousIdentifierExpressionNode)
01533         {
01534             var token = ((AmbiguousIdentifierExpressionNode)expressionNode).Token;
01535             
01536             if (token.SyntaxKind != SyntaxKind.IdentifierToken)
01537                 return lambdaExpressionNode;
01538         
01539             var variableDeclarationNode = ParseVariables.HandleVariableDeclarationExpression(
01540                 TypeFacts.Empty.ToTypeClause(),
01541                 (IdentifierToken)token,
01542                 VariableKind.Local,
01543                 model);
01544                 
01545             lambdaExpressionNode.AddVariableDeclarationNode(variableDeclarationNode);
01546         }
01547         
01548         return lambdaExpressionNode;
01549     }
01550     
01565     public void ClearFromExpressionList(IExpressionNode expressionNode, IParserModel model)
01566     {
01567         for (int i = model.ExpressionList.Count - 1; i > -1; i--)
01568         {
01569             var delimiterExpressionTuple = model.ExpressionList[i];
01570             
01571             if (Object.ReferenceEquals(expressionNode, delimiterExpressionTuple.ExpressionNode))
01572                 model.ExpressionList.RemoveAt(i);
01573         }
01574     }
